import React, { useState, useEffect } from 'react';
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  TouchableOpacity,
  ActivityIndicator,
  Platform,
  Dimensions,
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { useNavigation } from '@react-navigation/native';
import axios from 'axios';
import { LineChart, BarChart } from 'react-native-chart-kit';

interface ModelMetrics {
  accuracy: number;
  precision: number;
  recall: number;
  f1Score: number;
  auc: number;
}

interface FeatureImportance {
  feature: string;
  importance: number;
}

interface AIModel {
  id: string;
  name: string;
  category: string;
  description: string;
  version: string;
  status: 'active' | 'training' | 'deprecated';
  metrics: ModelMetrics;
  featureImportance: FeatureImportance[];
  lastUpdated: string;
  trainingDataSize: number;
  icon: keyof typeof Ionicons.glyphMap;
  color: string;
}

const AIPredictionModelsScreen: React.FC = () => {
  const navigation = useNavigation();
  const [models, setModels] = useState<AIModel[]>([]);
  const [loading, setLoading] = useState(true);
  const [selectedModel, setSelectedModel] = useState<AIModel | null>(null);
  const [showDetails, setShowDetails] = useState(false);

  const API_URL = process.env.EXPO_PUBLIC_API_URL || 'http://localhost:3000';

  useEffect(() => {
    fetchModels();
  }, []);

  const fetchModels = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`${API_URL}/api/ml/models`);
      setModels(response.data.models);
    } catch (error) {
      console.error('Failed to fetch models:', error);
      // Use mock data for demo
      setModels(mockModels);
    } finally {
      setLoading(false);
    }
  };

  const getStatusColor = (status: string) => {
    switch (status) {
      case 'active':
        return '#4CAF50';
      case 'training':
        return '#FFC107';
      case 'deprecated':
        return '#F44336';
      default:
        return '#999';
    }
  };

  const getMetricColor = (value: number) => {
    if (value >= 0.9) return '#4CAF50';
    if (value >= 0.75) return '#8BC34A';
    if (value >= 0.6) return '#FFC107';
    return '#F44336';
  };

  const renderModelCard = (model: AIModel) => (
    <TouchableOpacity
      key={model.id}
      style={[styles.modelCard, { borderLeftColor: model.color }]}
      onPress={() => {
        setSelectedModel(model);
        setShowDetails(true);
      }}
    >
      <View style={styles.modelHeader}>
        <View style={[styles.iconContainer, { backgroundColor: model.color + '20' }]}>
          <Ionicons name={model.icon} size={32} color={model.color} />
        </View>
        <View style={styles.modelInfo}>
          <Text style={styles.modelName}>{model.name}</Text>
          <Text style={styles.modelCategory}>{model.category}</Text>
        </View>
        <View style={[styles.statusBadge, { backgroundColor: getStatusColor(model.status) }]}>
          <Text style={styles.statusText}>{model.status.toUpperCase()}</Text>
        </View>
      </View>

      <Text style={styles.modelDescription}>{model.description}</Text>

      <View style={styles.metricsRow}>
        <View style={styles.metricItem}>
          <Text style={styles.metricLabel}>Accuracy</Text>
          <Text style={[styles.metricValue, { color: getMetricColor(model.metrics.accuracy) }]}>
            {(model.metrics.accuracy * 100).toFixed(1)}%
          </Text>
        </View>
        <View style={styles.metricItem}>
          <Text style={styles.metricLabel}>Precision</Text>
          <Text style={[styles.metricValue, { color: getMetricColor(model.metrics.precision) }]}>
            {(model.metrics.precision * 100).toFixed(1)}%
          </Text>
        </View>
        <View style={styles.metricItem}>
          <Text style={styles.metricLabel}>AUC</Text>
          <Text style={[styles.metricValue, { color: getMetricColor(model.metrics.auc) }]}>
            {model.metrics.auc.toFixed(3)}
          </Text>
        </View>
      </View>

      <View style={styles.modelFooter}>
        <Text style={styles.versionText}>v{model.version}</Text>
        <Text style={styles.updatedText}>
          Updated: {new Date(model.lastUpdated).toLocaleDateString()}
        </Text>
      </View>
    </TouchableOpacity>
  );

  const renderModelDetails = () => {
    if (!selectedModel) return null;

    const screenWidth = Dimensions.get('window').width;
    const chartConfig = {
      backgroundColor: '#FFFFFF',
      backgroundGradientFrom: '#FFFFFF',
      backgroundGradientTo: '#FFFFFF',
      decimalPlaces: 2,
      color: (opacity = 1) => `rgba(33, 150, 243, ${opacity})`,
      labelColor: (opacity = 1) => `rgba(0, 0, 0, ${opacity})`,
      style: {
        borderRadius: 16,
      },
      propsForDots: {
        r: '6',
        strokeWidth: '2',
        stroke: '#2196F3',
      },
    };

    return (
      <View style={styles.detailsOverlay}>
        <View style={styles.detailsContainer}>
          <View style={styles.detailsHeader}>
            <Text style={styles.detailsTitle}>{selectedModel.name}</Text>
            <TouchableOpacity onPress={() => setShowDetails(false)}>
              <Ionicons name="close" size={28} color="#333" />
            </TouchableOpacity>
          </View>

          <ScrollView style={styles.detailsContent} showsVerticalScrollIndicator={false}>
            {/* Model Overview */}
            <View style={styles.detailsSection}>
              <Text style={styles.sectionTitle}>Model Overview</Text>
              <View style={styles.overviewGrid}>
                <View style={styles.overviewItem}>
                  <Text style={styles.overviewLabel}>Version</Text>
                  <Text style={styles.overviewValue}>{selectedModel.version}</Text>
                </View>
                <View style={styles.overviewItem}>
                  <Text style={styles.overviewLabel}>Status</Text>
                  <Text
                    style={[
                      styles.overviewValue,
                      { color: getStatusColor(selectedModel.status) },
                    ]}
                  >
                    {selectedModel.status}
                  </Text>
                </View>
                <View style={styles.overviewItem}>
                  <Text style={styles.overviewLabel}>Training Data</Text>
                  <Text style={styles.overviewValue}>
                    {selectedModel.trainingDataSize.toLocaleString()}
                  </Text>
                </View>
                <View style={styles.overviewItem}>
                  <Text style={styles.overviewLabel}>Last Updated</Text>
                  <Text style={styles.overviewValue}>
                    {new Date(selectedModel.lastUpdated).toLocaleDateString()}
                  </Text>
                </View>
              </View>
            </View>

            {/* Performance Metrics */}
            <View style={styles.detailsSection}>
              <Text style={styles.sectionTitle}>Performance Metrics</Text>
              <View style={styles.metricsGrid}>
                <View style={styles.metricCard}>
                  <Text style={styles.metricCardLabel}>Accuracy</Text>
                  <Text
                    style={[
                      styles.metricCardValue,
                      { color: getMetricColor(selectedModel.metrics.accuracy) },
                    ]}
                  >
                    {(selectedModel.metrics.accuracy * 100).toFixed(2)}%
                  </Text>
                  <View style={styles.metricBar}>
                    <View
                      style={[
                        styles.metricBarFill,
                        {
                          width: `${selectedModel.metrics.accuracy * 100}%`,
                          backgroundColor: getMetricColor(selectedModel.metrics.accuracy),
                        },
                      ]}
                    />
                  </View>
                </View>

                <View style={styles.metricCard}>
                  <Text style={styles.metricCardLabel}>Precision</Text>
                  <Text
                    style={[
                      styles.metricCardValue,
                      { color: getMetricColor(selectedModel.metrics.precision) },
                    ]}
                  >
                    {(selectedModel.metrics.precision * 100).toFixed(2)}%
                  </Text>
                  <View style={styles.metricBar}>
                    <View
                      style={[
                        styles.metricBarFill,
                        {
                          width: `${selectedModel.metrics.precision * 100}%`,
                          backgroundColor: getMetricColor(selectedModel.metrics.precision),
                        },
                      ]}
                    />
                  </View>
                </View>

                <View style={styles.metricCard}>
                  <Text style={styles.metricCardLabel}>Recall</Text>
                  <Text
                    style={[
                      styles.metricCardValue,
                      { color: getMetricColor(selectedModel.metrics.recall) },
                    ]}
                  >
                    {(selectedModel.metrics.recall * 100).toFixed(2)}%
                  </Text>
                  <View style={styles.metricBar}>
                    <View
                      style={[
                        styles.metricBarFill,
                        {
                          width: `${selectedModel.metrics.recall * 100}%`,
                          backgroundColor: getMetricColor(selectedModel.metrics.recall),
                        },
                      ]}
                    />
                  </View>
                </View>

                <View style={styles.metricCard}>
                  <Text style={styles.metricCardLabel}>F1 Score</Text>
                  <Text
                    style={[
                      styles.metricCardValue,
                      { color: getMetricColor(selectedModel.metrics.f1Score) },
                    ]}
                  >
                    {selectedModel.metrics.f1Score.toFixed(3)}
                  </Text>
                  <View style={styles.metricBar}>
                    <View
                      style={[
                        styles.metricBarFill,
                        {
                          width: `${selectedModel.metrics.f1Score * 100}%`,
                          backgroundColor: getMetricColor(selectedModel.metrics.f1Score),
                        },
                      ]}
                    />
                  </View>
                </View>

                <View style={styles.metricCard}>
                  <Text style={styles.metricCardLabel}>AUC-ROC</Text>
                  <Text
                    style={[
                      styles.metricCardValue,
                      { color: getMetricColor(selectedModel.metrics.auc) },
                    ]}
                  >
                    {selectedModel.metrics.auc.toFixed(3)}
                  </Text>
                  <View style={styles.metricBar}>
                    <View
                      style={[
                        styles.metricBarFill,
                        {
                          width: `${selectedModel.metrics.auc * 100}%`,
                          backgroundColor: getMetricColor(selectedModel.metrics.auc),
                        },
                      ]}
                    />
                  </View>
                </View>
              </View>
            </View>

            {/* Feature Importance */}
            <View style={styles.detailsSection}>
              <Text style={styles.sectionTitle}>Feature Importance</Text>
              <BarChart
                data={{
                  labels: selectedModel.featureImportance.slice(0, 5).map((f) => f.feature),
                  datasets: [
                    {
                      data: selectedModel.featureImportance.slice(0, 5).map((f) => f.importance),
                    },
                  ],
                }}
                width={screenWidth - 80}
                height={220}
                chartConfig={chartConfig}
                style={styles.chart}
                yAxisLabel=""
                yAxisSuffix=""
                fromZero
              />
            </View>

            {/* ML Pipeline */}
            <View style={styles.detailsSection}>
              <Text style={styles.sectionTitle}>ML Pipeline</Text>
              <View style={styles.pipelineContainer}>
                <View style={styles.pipelineStep}>
                  <View style={[styles.pipelineIcon, { backgroundColor: '#E3F2FD' }]}>
                    <Ionicons name="document-text" size={24} color="#2196F3" />
                  </View>
                  <Text style={styles.pipelineStepTitle}>Data Collection</Text>
                  <Text style={styles.pipelineStepDesc}>Aggregate health records</Text>
                </View>

                <Ionicons name="arrow-forward" size={20} color="#999" style={{ marginTop: 20 }} />

                <View style={styles.pipelineStep}>
                  <View style={[styles.pipelineIcon, { backgroundColor: '#FFF3E0' }]}>
                    <Ionicons name="build" size={24} color="#FF9800" />
                  </View>
                  <Text style={styles.pipelineStepTitle}>Preprocessing</Text>
                  <Text style={styles.pipelineStepDesc}>Clean & normalize</Text>
                </View>

                <Ionicons name="arrow-forward" size={20} color="#999" style={{ marginTop: 20 }} />

                <View style={styles.pipelineStep}>
                  <View style={[styles.pipelineIcon, { backgroundColor: '#F3E5F5' }]}>
                    <Ionicons name="analytics" size={24} color="#9C27B0" />
                  </View>
                  <Text style={styles.pipelineStepTitle}>Training</Text>
                  <Text style={styles.pipelineStepDesc}>Model optimization</Text>
                </View>

                <Ionicons name="arrow-forward" size={20} color="#999" style={{ marginTop: 20 }} />

                <View style={styles.pipelineStep}>
                  <View style={[styles.pipelineIcon, { backgroundColor: '#E8F5E9' }]}>
                    <Ionicons name="checkmark-circle" size={24} color="#4CAF50" />
                  </View>
                  <Text style={styles.pipelineStepTitle}>Deployment</Text>
                  <Text style={styles.pipelineStepDesc}>Production ready</Text>
                </View>
              </View>
            </View>

            {/* Explainability */}
            <View style={styles.detailsSection}>
              <Text style={styles.sectionTitle}>Model Explainability</Text>
              <View style={styles.explainabilityContainer}>
                <View style={styles.explainabilityMethod}>
                  <Ionicons name="bulb" size={24} color="#FFC107" />
                  <View style={{ flex: 1 }}>
                    <Text style={styles.explainabilityTitle}>SHAP Values</Text>
                    <Text style={styles.explainabilityDesc}>
                      Shapley Additive Explanations for individual predictions
                    </Text>
                  </View>
                </View>

                <View style={styles.explainabilityMethod}>
                  <Ionicons name="eye" size={24} color="#2196F3" />
                  <View style={{ flex: 1 }}>
                    <Text style={styles.explainabilityTitle}>LIME</Text>
                    <Text style={styles.explainabilityDesc}>
                      Local Interpretable Model-agnostic Explanations
                    </Text>
                  </View>
                </View>

                <View style={styles.explainabilityMethod}>
                  <Ionicons name="stats-chart" size={24} color="#4CAF50" />
                  <View style={{ flex: 1 }}>
                    <Text style={styles.explainabilityTitle}>Feature Attribution</Text>
                    <Text style={styles.explainabilityDesc}>
                      Contribution analysis for each input feature
                    </Text>
                  </View>
                </View>
              </View>
            </View>
          </ScrollView>
        </View>
      </View>
    );
